import styled from 'styled-components';

export const Container = styled.div`
    height: 100%;

    display: flex;
    justify-content: center;
    align-items: center;
`;

export const FormContainer = styled.div`
    max-width: 500px;
    max-height: 700px;

    height: 70%;
    width: 70%;
    border: 1px solid #222;

    display: flex;
    justify-content: center;
